import React, { Component } from "react";

export default class Footer extends Component {
  render() {
    return (
      <div style={{ backgroundColor: "black" }}>
        <table>
          <li>foo</li>
          <li>bar</li>
          <li>test</li>
        </table>
      </div>
    );
  }
}
